$().ready(function() {
    var a = io(), b = $("#logs").find("tbody");
    $("#login").submit(function() {
        $(".loader").removeClass("hidden"), $.ajax({
            type: "POST",
            url: "/login",
            cache: !1
        });
    }), a.on("userData", function(a) {
        var c = "<tr>";
        for (k in a) c += "method" === k ? "GET" === a.method ? '<td class="btn btn-success">' : "POST" === a.method ? '<td class="btn btn-danger">' : '<td class="btn btn-info">' : "<td>", 
        c += a[k] + "</td>";
        c += "</tr>", b.append(c);
    }), $(window).on("beforeunload", function() {
        a.close();
    });
});